import React from 'react';

class PlayerForm extends React.Component {



    render() {
        return (
            <div class="container">
                <form>
                    <ul class="flex-outer">
                        <li>
                            <label for="name">Nom du joueur</label>
                            <input type="text" id="name" />
                        </li>
                        <li>
                            <label for="team">Nom du joueur</label>
                            <input type="text" id="name" />
                        </li>
                    </ul>
                </form>
            </div>
        )
    }
}

export default PlayerForm;
